const e={name:"Die Kuh bringt's",date:"2012-01-01T00:00:00.000Z",start:"2012-04-01T00:00:00.000Z",end:"2013-10-01T00:00:00.000Z",languages:["JavaScript","PHP","HTML","CSS3"],tools:["MySQL"],typewriter:{"remove-letters":598},tags:"project"},i=`<p>Bereits vor meinem Studium habe ich immer wieder kleinere Projekte initiiert. Als ich erfuhr, dass die Bauern von den gezahlten Milchpreisen nicht leben können und aus Protest sogar die Milch wegkippten, stellte ich mir die Frage, warum diese nicht stärker in die Selbstvermarktung gehen. Schnell wurde mir klar, dass hier ein Mangel besteht, und ich habe mich tiefer mit dem Thema auseinandergesetzt. Um ein Business aufzubauen, habe ich mit der Programmierung eines Online-Shops begonnen und zusätzlich Seminare an der Hochschule zum Thema Entrepreneurship besucht. Ich habe viel gelernt, im Nachhinein betrachtet aber auch vieles falsch gemacht. Diese Erfahrungen haben meine Entwicklung geprägt und als erstes großes Projekt habe ich viel Wissen vermittelt bekommen, von dem ich bis heute profitiere.</p>
<p>Besonders hervorheben möchte ich die Projekte, die ich in dieser Zeit durchgeführt habe. Ich habe gelernt, über den Tellerrand zu schauen und auch über die eigentliche Software hinauszudenken.</p>
`;export{e as data,i as html};
